import male25 from '../../images/male25.png'
import { Link } from 'react-router-dom'
import './male.css'



export default class MalePics extends Component {
    constructor() {
        super()

        this.state = {
            bodyFat7: 0.07,
            bodyFat15: 0.15,
            bodyFat25: 0.25
